import React from "react";
const ProjectPricing = ({ navHidden, hideNav, switchNavState }) => {
  return (
    <div>
      <NavBar
        color="black"
        active="services"
        navHidden={navHidden}
        hideNav={hideNav}
        switchNavState={switchNavState}
      />
    </div>
  );
};

export default ProjectPricing;
